// UncleJerry23/steven-universe-graphql-api 
import styles from './Home.module.css';
import logo from './../../img/logo.png'
import CardHome from '../../components/CardHome';
import Nav from '../../components/Nav';


function Home() {
  const navItems = ["Home", "Characters", "Episodes", "Songs"];

  return (
    <>
    <Nav items = {navItems} /> 
      <main className = {styles.main}>

        <img className = {styles.logo} src={logo} alt='logo steven universe'/>
        <div className={styles.cardContainer}>
          <CardHome title="Characters"/>
          <CardHome title="Episodes"/>
          <CardHome title="Songs"/>
        </div>
      </main>      
    </>
  );
}

export default Home;
